import React, { useState } from "react";

import Typography from "@material-ui/core/Typography";
import AStepperForm from "./aStepperForm";
import AStepperFormPart from "./aStepperFormPart";
import ATextField from "./aTextField";
import ASection from "./aSection";

const TestContentPanel4 = (props) => {
  return (
    <AStepperForm
      defaultModeMapping={{ pp: "disabled", q1: "readOnly", q2: "edit" }}
    >
      <AStepperFormPart name="a" title="Personal Particulars">
        <ATextField name="firstName" mode="goHome" />
        <ATextField name="lastName" mode="goHome" />
        <ATextField name="address" />
      </AStepperFormPart>
      <AStepperFormPart name="b" title="Questionnaire 1">
        <ATextField name="Why am I here?" variant="questionnaire" />
        <ATextField name="Why are you here?" variant="questionnaire" />
        <ATextField name="Why are we here?" variant="questionnaire" />
        <ATextField name="What are you here?" variant="classic" />
        <ATextField name="What are we here?" variant="questionnaire" />
      </AStepperFormPart>
      <AStepperFormPart
        name="c"
        title="Questionnaire 2"
        defaultVariant="questionnaire"
      >
        <ATextField name="Where am I here?" variant="questionnaire" />
        <ATextField name="Where are you here?" variant="questionnaire" />
        <ATextField name="Where are we here?" variant="questionnaire" />
      </AStepperFormPart>
    </AStepperForm>
  );
};
export default TestContentPanel4;
